import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './pages/Home';
import ActivationRoutine from './pages/ActivationRoutine';
import RecoveryRoutine from './pages/RecoveryRoutine';
import NotFound from './pages/NotFound.js'; // 404 Page for unmatched routes

function App() {
  return (
    <Router>
      <Routes>
        {/* Route for Home Page */}
        <Route path="/" element={<Home />} />

        {/* Route for Activation Routine Page */}
        <Route path="/activation" element={<ActivationRoutine />} />

        {/* Route for Recovery Routine Page */}
        <Route path="/recovery" element={<RecoveryRoutine />} />

        {/* Route for 404 Not Found Page */}
        <Route path="*" element={<NotFound />} />
      </Routes>
    </Router>
  );
}

export default App;
